Is there interest in updating the C++ API to use modern C++ best practices? From what I can tell, the C++ API is just a simple wrapper around the C API. It could in theory be more supportive of modern C++ standards and handle the necessary conversions to the C API.

For example, support for `std::string` over `const char *` would improve the ability to integrate with other frameworks/libraries instead of forcing C++ devs to drop down to C-style syntax.

For example
```
// works only because of implicit conversion
size_t num_nodes = session.GetInputCount();
std::vector<std::string> input_node_names;
for (int i=0; i<num_nodes; i++) {
    input_node_names.push_back( session.GetInputName(i, allocator) );
}

size_t num_nodes = session.GetOutputCount();
std::vector<std::string> output_node_names;
for (int i=0; i<num_nodes; i++) {
    output_node_names.push_back( session.GetOututName(i, allocator) );
}
```

But when trying to run inferrence:
```
// will not work
std::vector<Ort::Value> output_tensors = session.Run(Ort::RunOptions{nullptr}, input_node_names.data(), input_tensors.data(), input_tensors.size(), output_node_names.data(), output_node_names.size());
```

because `input_node_names` and `output_node_names` are strings.

**Describe the solution you'd like**
Add support for the string type in the public API functions. This could also lead to simplifying the `Run()` call to something like:

```cpp
std::vector<Ort::Value> output_tensors = session.Run(Ort::RunOptions{nullptr}, input_node_names, input_tensors.data(), input_tensors.size(), output_node_names);
```

**Additional context**
In general, I would appreciate more modern C++ standards supported by the C++ API with direct support for STL containers (i.e. std::vector) and the string type. Perhaps the C++ API could make better use of function templates to allow this - but starting by adding support for the `string` type would be a first step.
